import logo from "../../helper/logo.png";
import "./Navbar.scss"

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="logo">
                <img src={logo} alt="horoscope" />

            </div>

        </div>
    );
};

export default Navbar
